[include mainsail.cfg]
[include sensorless-homing.cfg]
[include led_configs.cfg]
[include config_backup.cfg]
[include test_speed.cfg]
[include macros.cfg]
[include thefilter.cfg]
[include KAMP_Settings.cfg]

[save_variables]
filename:~/printer_data/config/variables.cfg

#####################################################################
#   UUID Setting
#####################################################################
[mcu]
canbus_uuid:d8528f4d4569

#[mcu EBBCan]
#canbus_uuid: e2ae401d64e2

#[mcu FLY36]
#canbus_uuid: 0d6578e2c513

[mcu EBB36]
canbus_uuid: 2fb33ee5d0fa

#[mcu ampon]
#serial: /dev/serial/by-id/usb-Anchor_Ampon-if00

[mcu scanner]
#canbus_uuid: 8711695f3800
canbus_uuid: 8086618dbedf

[scanner]
mcu: scanner            
#   Offsets are measured from the centre of your coil, to the tip of your nozzle
#   on a level axis. It is vital that this is accurate.
x_offset: 0
#    adjust for your cartographers offset from nozzle to middle of coil
y_offset: 21.35
#    adjust for your cartographers offset from nozzle to middle of coil
backlash_comp: 0.00958
#   Backlash compensation distance for removing Z backlash before measuring
#   the sensor response.
sensor: cartographer
#    this must be set as cartographer unless using IDM etc.
sensor_alt: carto
#    alternate name to call commands. CARTO_TOUCH etc      
mesh_runs: 2
#    Number of passes to make during mesh scan.

[temperature_sensor Cartographer_MCU]
sensor_type: temperature_mcu
sensor_mcu: scanner
min_temp: 0
max_temp: 105

[shaketune]
# result_folder: ~/printer_data/config/ShakeTune_results
#    The folder where the results will be stored. It will be created if it doesn't exist.
# number_of_results_to_keep: 3
#    The number of results to keep in the result_folder. The oldest results will
#    be automatically deleted after each runs.
# keep_raw_data: False
#    If True, the raw CSV files will be kept in the result_folder alongside the
#    PNG graphs. If False, they will be deleted and only the graphs will be kept.
# show_macros_in_webui: True
#    Mainsail and Fluidd doesn't create buttons for "system" macros that are not in the
#    printer.cfg file. If you want to see the macros in the webui, set this to True.
# timeout: 300
#    The maximum time in seconds to let Shake&Tune process the CSV files and generate the graphs.

[printer]
kinematics: corexy
max_velocity: 300  
max_accel: 5460
max_z_velocity: 25 			
max_z_accel: 350
square_corner_velocity: 5.0

#####################################################################
# 	X/Y Stepper Settings
#####################################################################

## X Stepper on Motor1(B Motor)
[stepper_x]
step_pin: PE6
dir_pin: !PE5
enable_pin: !PC14
microsteps: 64
rotation_distance: 40
endstop_pin: tmc2209_stepper_x:virtual_endstop
position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 45   #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PC13
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0
diag_pin: ^PF4
driver_SGTHRS: 100 # 255 is most sensitive value, 0 is least sensitive
interpolate: true

[autotune_tmc stepper_x]
motor: moons-ms17hd6p4200
SG4_THRS=100

## Y Stepper on Motor2 (A Motor)
[stepper_y]
step_pin: PE2
dir_pin: !PE1
enable_pin: !PE4
microsteps: 64
rotation_distance: 40
endstop_pin: tmc2209_stepper_y:virtual_endstop
position_min: 0
position_endstop: 350
position_max: 350
homing_speed: 45  #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: PE3
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0
diag_pin: ^PF3
driver_SGTHRS: 100 # 255 is most sensitive value, 0 is least sensitive
interpolate: true

[autotune_tmc stepper_y]
motor: moons-ms17hd6p4200
SG4_THRS=100

#####################################################################
# 	Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left on MOTOR3
[stepper_z]
step_pin: PB8
dir_pin: !PB7
enable_pin: !PE0
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16
#endstop_pin: ^PF5
endstop_pin: probe:z_virtual_endstop
position_max: 330
homing_retract_dist: 0 # cartographer needs this to be set to 0
position_min: -20
homing_speed: 8
second_homing_speed: 3

[tmc2209 stepper_z]
uart_pin: PB9
interpolate: True
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0

[autotune_tmc stepper_z]
motor: moons-ms17hd6p4200

##	Z1 Stepper - Rear Left on Motor4
[stepper_z1]
step_pin: PB4
dir_pin: PB3
enable_pin: !PB6
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z1]
uart_pin: PB5
interpolate: True
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0

[autotune_tmc stepper_z1]
motor: moons-ms17hd6p4200

##	Z2 Stepper - Rear Right on Motor5
[stepper_z2]
step_pin: PG13
dir_pin: !PG12
enable_pin: !PG15
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z2]
uart_pin: PG14
interpolate: True
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0

[autotune_tmc stepper_z2]
motor: moons-ms17hd6p4200

##	Z3 Stepper - Front Right on Motor6
[stepper_z3]
step_pin: PG9
dir_pin: PD7
enable_pin: !PG11
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z3]
uart_pin: PG10
interpolate: True
run_current: 1.2
sense_resistor: 0.110
#stealthchop_threshold: 0

[autotune_tmc stepper_z3]
motor: moons-ms17hd6p4200

[extruder]
step_pin: EBB36: PD0
dir_pin: !EBB36: PD1
enable_pin: !EBB36: PD2
microsteps: 16
#rotation_distance: 21.9985825 ; CW2 Stock
#rotation_distance: 18.056436516 ; HextrudORT
rotation_distance: 17.697708569479 ; updated HextrudORT
gear_ratio: 50:10
nozzle_diameter: 0.600
filament_diameter: 1.750
heater_pin: EBB36: PB13
sensor_type: ATC Semitec 104NT-4-R025H42G
sensor_pin: EBB36: PA3
pressure_advance: 0.021
min_temp: 0
max_temp: 280
min_extrude_temp: 0
max_extrude_cross_section: 5
max_extrude_only_distance: 101

[tmc2209 extruder]
uart_pin: EBB36: PA15
run_current: 0.7
#stealthchop_threshold: 999999

[fan]
pin: EBB36: PA1
kick_start_time: 0.5
off_below: 0.2

[heater_fan hotend_fan]
pin: EBB36: PA0
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0
##  If you are experiencing back flow, you can reduce fan_speed
#fan_speed: 1.0

[heater_bed]
heater_pin: PA1
sensor_type: Generic 3950
sensor_pin: PB1
max_power: 1.0
min_temp: 0
max_temp: 120

[temperature_sensor buildplate]
sensor_type: Generic 3950
sensor_pin: PB0
min_temp: -40
max_temp: 120

[temperature_fan chamber]
pin: PF9
max_power: 1.0
shutdown_speed: 0.0
kick_start_time: 5.0
cycle_time:0.01
off_below:0.1
sensor_type: Generic 3950
sensor_pin: PC5
min_temp: -40
max_temp: 100
target_temp: 50.0
control: watermark
gcode_id: C

[temperature_sensor CM4]
sensor_type: temperature_host

[firmware_retraction]
retract_length: 0.5
retract_speed: 35

[multi_pin controller_fan_pins]
pins: PF7, PF8, PA4

[controller_fan controller_fan]
pin: multi_pin:controller_fan_pins
max_power: 0.4
kick_start_time: 0.5
heater: heater_bed

[quad_gantry_level]
gantry_corners:
	-77,-22
    427,425
points:
    50,25
    50,300
    300,300
    300,25
speed: 100
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.0075
max_adjust: 10

[bed_mesh]
speed: 200
horizontal_move_z: 5
mesh_min: 50,50
mesh_max: 300,300
probe_count: 30,30
zero_reference_position: 170, 170  
algorithm: bicubic
bicubic_tension: 0.2

[adxl345 EBB36]
cs_pin: EBB36: PB12
spi_software_sclk_pin: EBB36: PB10
spi_software_mosi_pin: EBB36: PB11
spi_software_miso_pin: EBB36: PB2
axes_map: z,-y,x

[adxl345 CARTO]
cs_pin: scanner:PA3
spi_bus: spi1

#[lis2dw]
#cs_pin: scanner:PA3
#spi_bus: spi1

#[adxl345 hotend]
#cs_pin: ampon:CS

[resonance_tester]
probe_points: 170, 170, 20
#accel_chip: adxl345
accel_chip: adxl345 CARTO
#accel_chip: lis2dw

[neopixel sb_leds]
pin: EBB36:PD3
chain_count: 3
color_order: GRBW
initial_RED: 1.0
initial_GREEN: 0.1
initial_BLUE: 0.0
initial_WHITE: 0.0

[axis_twist_compensation]
calibrate_start_x: 50
calibrate_end_x: 300
calibrate_y: 170

#################################################
################### Disco Led ###################
#################################################
[neopixel disco]
pin: PD15
chain_count: 50
color_order: GRB
initial_RED: 1.0
initial_GREEN: 0.1
initial_BLUE: 0.0

#################################################
################# Input Shaper ##################
#################################################
[input_shaper]
shaper_freq_x: 74.8
shaper_type_x: ei
shaper_freq_y: 43.2
shaper_type_y: mzv

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE7, EXP1_2=PG1,
    EXP1_3=PG0, EXP1_4=PF15,
    EXP1_5=PF14, EXP1_6=PF13,    # Slot in the socket on this side
    EXP1_7=PF12, EXP1_8=PF11,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PE13, EXP2_2=PE12,
    EXP2_3=PE15, EXP2_4=PE11,
    EXP2_5=PE10, EXP2_6=PE14,      # Slot in the socket on this side
    EXP2_7=PE8, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=<NC>

# Enable object exclusion
[exclude_object]

# Enable arcs support
[gcode_arcs]
resolution: 0.3

[pause_resume]
recover_velocity: 50.

[respond]
default_type: echo
#   Sets the default prefix of the "M118" and "RESPOND" output to one
#   of the following:
#       echo: "echo: " (This is the default)
#       command: "// "
#       error: "!! "
#default_prefix: echo:
#   Directly sets the default prefix. If present, this value will
#   override the "default_type".

